import React from "react";
// import Features1 from "./features1";
// import img1 from "../assets/image4.jpg";
// import img2 from "../assets/image6.jpg";
// import img3 from "../assets/image8.jpg";
// import img4 from "../assets/image9.jpg"; // Add paths to additional images
// import img5 from "../assets/image10.jpg"; // Add paths to additional images
// import img6 from "../assets/image11.jpg"; // Add paths to additional images
// import img7 from "../assets/image12.jpg"; // Add paths to additional images
// import img8 from "../assets/image13.jpg"; // Add paths to additional images
// import img9 from "../assets/image14.jpg"; // Add paths to additional images
// import img10 from "../assets/image15.jpg"; // Add paths to additional images
import "./projects.css";

const features = [
  {
    imgSrc: img1,
    imgAlt: "Modern Building Design",
    title: "Quality Construction Services",
    description: "Expert Building Contractors",
  },
  {
    imgSrc: img2,
    imgAlt: "Creative Building Concepts",
    title: "Customized Project Planning",
    description: "Innovative Architectural Designs",
  },
  {
    imgSrc: img3,
    imgAlt: "Eco-Friendly Construction",
    title: "Green Building Solutions",
    description: "Sustainable Construction Practices",
  },
  {
    imgSrc: img4,
    imgAlt: "Project Management",
    title: "Efficient Project Management",
    description: "On-time and within budget",
  },
  {
    imgSrc: img5,
    imgAlt: "Renovation Services",
    title: "Home Renovation",
    description: "Revamp your living space",
  },
  {
    imgSrc: img6,
    imgAlt: "Commercial Construction",
    title: "Commercial Construction",
    description: "Building business infrastructure",
  },
  {
    imgSrc: img7,
    imgAlt: "Interior Design",
    title: "Interior Design",
    description: "Modern and stylish interiors",
  },
  {
    imgSrc: img8,
    imgAlt: "Landscaping Services",
    title: "Landscaping",
    description: "Beautiful outdoor spaces",
  },
  {
    imgSrc: img9,
    imgAlt: "Plumbing Services",
    title: "Plumbing Services",
    description: "Expert plumbing solutions",
  },
  {
    imgSrc: img10,
    imgAlt: "Electrical Services",
    title: "Electrical Services",
    description: "Safe and efficient electrical work",
  },
];

const Projects = () => {
  return (
    <div className="projects-wrapper">
      <h1 className="projects-title">Our Projects</h1>
      {features.map((feature, index) => (
        <Features1 key={index} features={features} />
      ))}
    </div>
  );
};

export default Projects;
